import React from 'react';

// Components
import Recto from './Recto';
import Verso from './Verso';

function CardsContainer({cardNumber, cardName, expMonth, expYear, cvc}) {
  return (
    <div className='lg:h-full 2xl:w-[20%] lg:w-[15%] w-full flex flex-col-reverse justify-center items-center lg:gap-10 gap-0 -mt-44 mb-10'>
      <Recto cardNumber={cardNumber} cardName={cardName} expMonth={expMonth} expYear={expYear} />
      <Verso cvc={cvc} />
    </div>
  )
}
export default CardsContainer;
